import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import Register from './Component/Register'
import {Container, Row, Col} from 'react-bootstrap'

function App() {
  return (
    <Container>
      <Row></Row>
      <Row>
        <Col>
        <Register />
        </Col>
      </Row>
      <Row></Row>
    </Container>
  );
}

export default App;
